        await browser.url("/Hidden-Elements/index.html");
        await browser.execute(() => {

            return document.getElementById("not-displayed").setAttribute("id", "");

        });
        await browser.execute(() => {

            return document.body.style.backgroundColor = "tomato"
        });


        await browser.pause(3000); 
        
    });
